$(document).ready(function(){AOS.init({duration:600,mirror:!0,easing:"ease-in-out"});$("#backToTop").hide();$(window).bind("scroll",function(){$(this).scrollTop()>300?$("#backToTop").slideDown("fast"):$("#backToTop").hide("fast")});$("a[href='#top']").click(function(){return $("html, body").animate({scrollTop:"0px"},300),!1});$.ajax({url:"https://en.wikipedia.org/w/api.php",data:{format:"json",action:"parse",page:"Psychological_operations_(United_States)",prop:"text",section:0},dataType:"jsonp",success:function(n){console.log(n);$("#psyopData").html(n.parse.text["*"]);var i=n.parse.text["*"],t=$("<div><\/div>").html(i);t.find("a").each(function(){$(this).replaceWith($(this).html())});t.find("sup").remove();t.find(".mw-ext-cite-error").remove();t.find(".infobox").remove();$("#psyopData").html($(t).find("p"))}});$.ajax({url:"https://en.wikipedia.org/w/api.php",data:{format:"json",action:"parse",page:"Cavalry_scout",prop:"text",section:0},dataType:"jsonp",success:function(n){console.log(n);$("#scoutData").html(n.parse.text["*"]);var i=n.parse.text["*"],t=$("<div><\/div>").html(i);t.find("a").each(function(){$(this).replaceWith($(this).html())});t.find("sup").remove();t.find(".mw-ext-cite-error").remove();$("#scoutData").html($(t).find("p"))}})});